import { createTheme } from '@mui/material/styles';


const myTheme = createTheme({
    palette: {
        type: 'light',
        primary: {
            main: '#aa00ff',
        },
        secondary: {
            main: '#ff8f00',
        },
    },
});

export default myTheme;
